import {
  SearchHistoryItem,
} from "@/components/SearchHistoryItem/SearchHistoryItem";
import type {
  SearchHistoryItem as SearchHistoryItemType,
} from "@/stores/weather/slices/searchHistorySlice.types";
import type {
  Meta,
  StoryObj,
} from "@storybook/react";

import {
  withProviders,
} from "../path-to-storybook-helpers"; // Update with the actual path to your Storybook providers helper

const exampleHistoryItem: SearchHistoryItemType = {
  id: "1",
  locationInfo: {
    longitude: 103.851959,
    latitude: 1.29027,
    countryCode: "SG",
    regionName: "Singapore",
  },
  timeStamp: new Date().toISOString(),
  weatherInfo: {
    temperatureF: 86,
    weather: "Clear",
    weatherCode: 800,
    humidity: 70,
  },
};

const meta = {
  title: "components/SearchHistoryItem",
  component: SearchHistoryItem,
  decorators: [withProviders], // Add any required providers/decorators here
  parameters: {
    layout: "padded",
    backgrounds: {
      default: "white",
      values: [
        {
          name: "white",
          value: "#fff",
        },
        {
          name: "theme",
          value: "#6a44c8",
        },
      ],
    },
  },
} satisfies Meta<typeof SearchHistoryItem>;

export default meta;

type Story = StoryObj<typeof meta>;

export const Default: Story = {
  args: {
    history: exampleHistoryItem,
  },
};
